import React from 'react'
import { Table } from "react-bootstrap";

function THead() {
    return (
        <thead>
        <tr>
          <th>Employee</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Email</th>
        </tr>
      </thead>

    )
}

export default THead
